def solution(stdin: str) -> str:
    data = stdin.splitlines()

    n, d, k = [int(n) for n in data[0].split()]

    if n - 1 <= d * k:
        return "NO"

    if n - 1 <= d:
        return "YES"

    tree = {}
    tree[1] = {1: []}

    for i in range(2, n + 1):
        tree[i] = {}
        tree[i][i] = []

    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            if i not in tree[j]:
                tree[i][j] = []
                tree[j][i] = []

            if len(tree[i][j]) < k:
                tree[i][j].append(i)
                tree[j][i].append(j)

    def find_cycle(root: int, cycle: List[int]) -> bool:
        for vertex in tree[root][root]:
            if vertex in cycle:
                return True

            cycle.append(vertex)
            if find_cycle(vertex, cycle):
                return True

        cycle.pop()
        return False

    for vertex in tree[1][1]:
        cycle = [1, vertex]
        if find_cycle(vertex, cycle):
            cycle.append(vertex)
            break

    return "YES" if cycle else "NO"

