    A = [int(s) for s in stdin.split()]
    total = sum(A)

    # if total is odd, we cannot partition in 3 equal parts
    if total % 3!= 0:
        return "false"

    target = total // 3
    seen = set()
    seen.add(0)
    partitioned = False
    for a in A:
        if a == target:
            if 0 in seen:
                return "true"
        elif a < target:
            if target - a in seen:
                partitioned = True
            seen.add(a)
        else:
            seen.remove(a)

    return "false" if not partitioned else "true"

