        a, b, c = triangle
        s = (a+b+c)/2
        area = sqrt(s*(s-a)*(s-b)*(s-c))
        return area
    def perimeter(triangle: list) -> float:
        a, b, c = triangle
        return a+b+c
    def perimeterSum(tList: list) -> float:
        perimeterSum = 0
        for i in range(len(tList)-1):
            perimeterSum += perimeter(tList[i])
        return perimeterSum
    def anglesSum(tList: list) -> float:
        anglesSum = 0
        for i in range(len(tList)-2):
            anglesSum += triangleArea(tList[i])
        return anglesSum
    def minPerimeter(tList: list) -> float:
        return 2*anglesSum(tList)/perimeterSum(tList)
    return str(minPerimeter(polygonTriangle))

