        self.__temperatures = []
        self.__max_temperature = 0

    def add_temperature(self, temperature):
        self.__temperatures.append(temperature)
        if self.__max_temperature < temperature:
            self.__max_temperature = temperature

    def minimize_day(self, other):
        if self.__max_temperature > other.get_max_temperature():
            self.__max_temperature = other.get_max_temperature()
        if self.__max_temperature < other.get_min_temperature():
            self.__max_temperature = other.get_min_temperature()

    def get_day(self):
        return self.__max_temperature

    def get_max_temperature(self):
        return self.__max_temperature

    def get_min_temperature(self):
        return min(self.__temperatures)

